import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ExperienceCard from './ExperienceCard';
import PortfolioBuilder from './PortfolioBuilder';

const StudentDashboard = ({ token, logout }) => {
  const [experiences, setExperiences] = useState([]);
  const [user, setUser] = useState({ profile: { bio: '', description: '', profilePic: '', skills: [], links: { github: '', leetcode: '', figma: '', linkedin: '' } } });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      const config = { headers: { Authorization: `Bearer ${token}` } };
      try {
        const userRes = await axios.get('/api/user', config);
        setUser(userRes.data || { profile: { bio: '', description: '', profilePic: '', skills: [], links: { github: '', leetcode: '', figma: '', linkedin: '' } } });
        const expRes = await axios.get('/api/experience', config);
        setExperiences(expRes.data);
      } catch (err) {
        alert('Error fetching data: ' + (err.response?.data?.error || 'Unknown error'));
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [token]);

  const updateExperiences = async () => {
    const config = { headers: { Authorization: `Bearer ${token}` } };
    try {
      const expRes = await axios.get('/api/experience', config);
      setExperiences(expRes.data);
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  const handleAccept = async (id) => {
    const config = { headers: { Authorization: `Bearer ${token}` } };
    try {
      await axios.post(`/api/experience/${id}/accept`, {}, config);
      updateExperiences();
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  const handleDecline = async (id) => {
    const config = { headers: { Authorization: `Bearer ${token}` } };
    try {
      await axios.post(`/api/experience/${id}/decline`, {}, config);
      updateExperiences();
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  const toggleFeatured = async (id) => {
    const config = { headers: { Authorization: `Bearer ${token}` } };
    try {
      await axios.patch(`/api/experience/${id}/feature`, {}, config);
      updateExperiences();
    } catch (err) {
      alert('Error: ' + (err.response?.data?.error || 'Unknown error'));
    }
  };

  if (loading) return <div className="flex justify-center items-center h-screen"><div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-500"></div></div>;

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold text-gray-900">Student Dashboard</h1>
        <button onClick={logout} className="text-red-600 hover:text-red-800">
          Logout
        </button>
      </div>
      <PortfolioBuilder user={user} token={token} setUser={setUser} />
      <h2 className="text-2xl font-semibold text-gray-800 mt-6 mb-4">Your Experiences</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {experiences.length === 0 ? (
          <p className="col-span-full text-center text-gray-500">No experiences yet.</p>
        ) : (
          experiences.map(exp => (
            <ExperienceCard key={exp._id} exp={exp} onAccept={handleAccept} onDecline={handleDecline} onToggleFeatured={toggleFeatured} role="student" />
          ))
        )}
      </div>
    </div>
  );
};

export default StudentDashboard;
